using Microsoft.ML;
using Services.MachineLearning.DataModels;
using Services.MachineLearning.Trainers;

namespace Services.MachineLearning
{
    public class TaskEstimationService
    {
        private ITrainerBase _trainer { get; set; }

        private ITransformer _model;

        private readonly MLContext _mlContext;


        public TaskEstimationService()
        {
            _mlContext = new MLContext(111);
            _trainer = new TaskTotalDaysRegressionTrainer();
        }

        private ITransformer initializeModel() 
        {
            _model = _trainer.Fit(GetTrainData()); 
            return _model;
        }

        public TaskEstimationPrediction PredictLateTask(TaskData aSample)
        {
            if (aSample.UserInChargeEfficiency.Equals(0))
            {
                aSample.UserInChargeEfficiency = 1f;
            }

            if (aSample.UserReportToEfficiency.Equals(0))
            {
                aSample.UserReportToEfficiency = 1f;
            }

            _model = initializeModel();

            var predictionEngine = _mlContext.Model.CreatePredictionEngine<TaskData, TaskEstimationPrediction>(_model);

            return predictionEngine.Predict(aSample);
        }

        public List<TaskEstimationPrediction> EstimateTaskCompletionDay(List<TaskData> data)
        {
            _model = initializeModel();

            var predictionEngine = _mlContext.Model.CreatePredictionEngine<TaskData, TaskEstimationPrediction>(_model);

            var predictions = new List<TaskEstimationPrediction>();

            foreach (var taskData in data)
            {
                predictions.Add(predictionEngine.Predict(taskData));
            }

            return predictions;
        }

        public TaskEstimationPrediction EstimateTaskCompletionDay(TaskData data)
        {
            _model = initializeModel();

            var predictionEngine = _mlContext.Model.CreatePredictionEngine<TaskData, TaskEstimationPrediction>(_model);

            return predictionEngine.Predict(data);
        }

